postcontent:
I have a PSA M4 16" Carbine Length stripped upper receiver. This is brand new in the original box, never mounted. I am looking to trade this for a 16" barreled upper with a mid-length gas system.


Info from PSA's website; 
16" Barrel length, Chrome moly vanadium barrel, 5.56 Nato Chamber, 1 in 7" twist rate, chrome-lined bore, M4 Feed ramps, F-Marked Front sight post, A2 Flash Hider, Sling Loop, Carbine Hand Guards w/ heat sheilds, Forged upper receiver, T-Marks.
